  title: "UnrealScript syntax"
  text:
    text: "<h2><span class=\"mw-headline\" id=\"Style\">Style</span><span class=\"\
      mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/UnrealScript_syntax?section=1\"\
      \ title=\"Edit section: Style\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h2>\n<p>These sections explain styles you should use. The\
      \ style is based upon Epic's style used in <a href=\"/UnrealScript\" title=\"\
      UnrealScript\">UnrealScript</a>.</p>\n<table style=\"\" class=\"metadata plainlinks\
      \ ambox ambox-content\">\n<tr>\n<td class=\"ambox-image\"></td>\n<td class=\"\
      ambox-text\">Please help <a rel=\"nofollow\" class=\"external text\" href=\"\
      https://wiki.beyondunreal.com/edit/UnrealScript_syntax\">improve this article\
      \ or section</a> by expanding it.<br />\n<i><sup>Further information might be\
      \ found on the <a href=\"/Talk:UnrealScript_syntax\" title=\"Talk:UnrealScript\
      \ syntax\">talk page</a>.</sup></i></td>\n</tr>\n</table>\n<p><br /></p>\n<h3><span\
      \ class=\"mw-headline\" id=\"Names\">Names</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/UnrealScript_syntax?section=2\"\
      \ title=\"Edit section: Names\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h3>\n<p>All variable/function names should be <a href=\"http://en.wikipedia.org/wiki/CamelCase\"\
      \ class=\"extiw\" title=\"wp:CamelCase\">UpperCamelCased</a>, e.g. <code>var\
      \ Object OwnerObject</code>.</p>\n<h4><span class=\"mw-headline\" id=\"Bool\"\
      >Bool</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\"\
      >[</span><a href=\"/edit/UnrealScript_syntax?section=3\" title=\"Edit section:\
      \ Bool\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h4>\n\
      <p><a href=\"/Bool\" title=\"Bool\" class=\"mw-redirect\">Bool's</a> should\
      \ start with a lowercase b, e.g. <code>bool bUnrealScriptStyle</code>.</p>\n\
      <h4><span class=\"mw-headline\" id=\"Enum\">Enum</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/UnrealScript_syntax?section=4\"\
      \ title=\"Edit section: Enum\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h4>\n<p><a href=\"/Enum\" title=\"Enum\" class=\"mw-redirect\"\
      >Enum's</a> should start with uppercase E, e.g. <code>enum EUnrealScriptStyle</code>.\
      \ Members should all start with all uppercase characters of the enum's name\
      \ followed by a _, e.g.</p>\n<div dir=\"ltr\" class=\"mw-geshi mw-code mw-content-ltr\"\
      >\n<div class=\"uscript source-uscript\">\n<pre class=\"de1\"><span class=\"\
      kw1\">enum</span> EUnrealScriptStyle\n<span class=\"br0\">{</span>\n    USS_Personal,\n\
      \    USS_EpicGames\n<span class=\"br0\">}</span>;</pre></div>\n</div>\n<h4><span\
      \ class=\"mw-headline\" id=\"Interface\">Interface</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/UnrealScript_syntax?section=5\"\
      \ title=\"Edit section: Interface\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h4>\n<p><a href=\"/Interface\" title=\"Interface\" class=\"\
      mw-redirect\">Interface's</a> should start with a uppercase I, e.g. <code>interface\
      \ IUnrealScriptStyle</code>.</p>\n<h2><span class=\"mw-headline\" id=\"Keywords\"\
      >Keywords</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\"\
      >[</span><a href=\"/edit/UnrealScript_syntax?section=6\" title=\"Edit section:\
      \ Keywords\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n\
      <p>This section lists all known UnrealScript keywords(188). This includes hard-coded\
      \ functionality of arrays like <b>Insert</b> etc, as well <b>d</b>eprecated,\
      \ <b>p</b>ostponed, <b>r</b>e-named and <b>c</b>anceled keywords. Note that\
      \ most keywords are context-sensitive in UnrealScript, so you can use most of\
      \ these for member or type names as well.</p>\n<table>\n<tr valign=\"top\">\n\
