  wikitext:
    text: "__NOTOC__\n==Style==\nThese sections explain styles you should use. The\
      \ style is based upon Epic's style used in [[UnrealScript]].\n{{expand}}\n\n\
      ===Names===\nAll variable/function names should be [[wp:CamelCase|UpperCamelCased]],\
      \ e.g. <code>var Object OwnerObject</code>.\n\n====Bool====\n[[Bool|Bool's]]\
      \ should start with a lowercase b, e.g. <code>bool bUnrealScriptStyle</code>.\n\
      \n====Enum====\n[[Enum|Enum's]] should start with uppercase E, e.g. <code>enum\
      \ EUnrealScriptStyle</code>.\nMembers should all start with all uppercase characters\
      \ of the enum's name followed by a _, e.g.\n<uscript>\nenum EUnrealScriptStyle\n\
      {\n    USS_Personal,\n    USS_EpicGames\n};</uscript>\n\n====Interface====\n\
      [[Interface|Interface's]] should start with a uppercase I, e.g. <code>interface\
      \ IUnrealScriptStyle</code>.\n\n==Keywords==\nThis section lists all known UnrealScript\
      \ keywords(188). This includes hard-coded functionality of arrays like '''Insert'''\
      \ etc, as well '''d'''eprecated, '''p'''ostponed, '''r'''e-named and '''c'''anceled\
      \ keywords. Note that most keywords are context-sensitive in UnrealScript, so\
      \ you can use most of these for member or type names as well.\n\n{|\n|-valign=\"\
      top\"\n\n|\n===A===\n*[[Abstract]]\n*[[Add]]\n*[[AddItem]]\n*[[Always]]<sup>C</sup>\n\
      *[[Archetype]]\n*[[Array]]\n*[[ArrayCount]]\n*[[Assert]]\n*[[Atomic]]\n*[[AtomicWhenCooked]]\n\
      *[[Auto]]\n*[[AutoCollapseCategories]]\n*[[AutoExpandCategories]]\n*[[Automated]]\n\
      |\n===B===\n*[[Begin]]\n*[[Bool]]\n*[[Break]]\n*[[Button]]\n*[[Byte]]\n|\n===C===\n\
      *[[Case]]\n*[[CacheExempt]]\n*[[Cache]]\n*[[Class]]\n*[[ClassGroup]]\n*[[Client]]\n\
      *[[Coerce]]\n*[[CollapseCategories]]\n*[[Config]]\n*[[Const]]\n*[[Continue]]\n\
      *[[Cpptext|CppStruct]]<sup>R</sup>\n*[[Cpptext|CppText]]\n*[[CrossLevelActive]]\n\
      *[[CrossLevelPassive]]\n|\n===D===\n*[[DataBinding]]\n*[[Default]]\n*[[Defaultproperties|DefaultProperties]]\n\
      *[[Delegate]]\n*[[DemoRecording]]\n*[[DependsOn]]\n*[[Deprecated]]\n*[[Depreciated]]<sup>U2</sup>\n\
      *[[Do]]\n*[[DontAutoCollapseCategories]]\n*[[DontCollapseCategories]]\n*[[DontSortCategories]]\n\
      *[[DLLBind]]\n*[[DLLImport]]\n*[[DuplicateTransient]]\n|\n===E===\n*[[EdFindable]]\n\
      *[[EditConst]]\n*[[EditConstArray]]\n*[[EditFixedSize]]\n*[[EditHide]]\n*[[EditorOnly]]\n\
      *[[EditInline]]\n*[[EditInlineNew]]\n*[[EditInlineNotify]]\n*[[EditInlineUse]]\n\
      *[[EditTextBox]]\n*[[Else]]\n*[[Empty]]\n*[[End]]\n*[[Enum]]\n*[[EnumCount]]\n\
      *[[Event]]\n*[[Exec]]\n*[[Expands]]\n*[[Export]]\n*[[ExportStructs]]\n*[[Extends]]\n\
      |\n===F===\n*[[False]]\n*[[FilterEditorOnly]]\n*[[Final]]\n*[[Find]]\n*[[Float]]\n\
      *[[For]]\n*[[ForceScriptOrder]]\n*[[ForEach]]\n*[[From]]<sup>C</sup>\n*[[Function]]\n\
      |\n===G===\n*[[Global]]\n*[[GlobalConfig]]\n*[[GoTo]]\n*[[Guid]]\n|-valign=\"\
      top\"\n|\n===H===\n*[[HideCategories]]\n*[[HideDropDown]]\n|\n===I===\n*[[If]]\n\
      *[[Ignores]]\n*[[Immutable]]\n*[[ImmutableWhenCooked]]\n*[[Implements]]\n*[[Import]]<sup>C</sup>\n\
      *[[Inherits]]\n*[[Init]]\n*[[Input]]\n*[[Insert]]\n*[[InsertItem]]\n*[[Instanced]]\n\
      *[[Int]]\n*[[Interface]]\n*[[Interp]]\n*[[Intrinsic]]\n*[[Invariant]]<sup>C</sup>\n\
      *[[Iterator]]\n|\n===K===\n*[[K2Call]]\n*[[K2Override]]\n*[[K2Pure]]\n|\n===L===\n\
      *[[Latent]]\n*[[Length]]\n*[[Local]]\n*[[Localized]]\n*[[Long]]\n|\n===M===\n\
      *[[Map]]\n|\n===N===\n*[[Name]]\n*[[NameOf]]\n*[[Native]]\n*[[NativeOnly]]\n\
      *[[NativeReplication]]\n*[[New]]\n*[[NoExport]]\n*[[NoExportHeader]]\n*[[NoClear]]\n\
      *[[NoImport]]\n*[[None]]\n*[[NonTransactional]]\n*[[NonTransient]]\n*[[NotEditInlineNew]]\n\
      *[[NotForConsole]]\n*[[NotInstanced]]\n*[[NotPlaceable]]\n*[[NoUserCreate]]\n\
      |\n===O===\n*[[Operator]]\n*[[Optional]]\n*[[OrderedArray]]<sup>U2</sup>\n*[[Out]]\n\
      |-valign=\"top\"\n|\n===P===\n*[[ParseConfig]]\n*[[PerObjectConfig]]\n*[[PerObjectLocalized]]\n\
      *[[Placeable]]\n*[[Private]]\n*[[PrivateWrite]]\n*[[PreOperator]]\n*[[Protected]]\n\
      *[[ProtectedWrite]]\n*[[Pointer]]\n*[[PostOperator]]\n*[[Public]]\n|\n===R===\n\
      *[[Reliable]]\n*[[Remove]]\n*[[RemoveIndex]]\n*[[RemoveItem]]\n*[[Replace]]\n\
      *[[Replication]]\n*[[RepNotify]]\n*[[RepRetry]]\n*[[Return]]\n*[[Rot]]\n*[[Rng]]<sup>C</sup>\n\
      |\n===S===\n*[[ShowCategories]]\n*[[Cpptext|StructCppText]]\n*[[Structdefaultproperties|StructDefaultProperties]]\n\
      *[[Structdefaultproperties|StructDefaults]]<sup>R</sup>\n*[[SafeReplace]]\n\
      *[[Self]]\n*[[Server]]\n*[[SerializeText]]\n*[[Simulated]]\n*[[Singular]]\n\
      *[[Skip]]\n*[[Sort]]\n*[[State]]\n*[[Stop]]\n*[[StrictConfig]]\n*[[String]]\n\
      *[[Struct]]\n*[[Super]]\n*[[Switch]]\n|\n===T===\n*[[Transient]]\n*[[Travel]]\n\
      *[[True]]\n|\n===U===\n*[[Unreliable]]\n*[[Until]]\n|\n===V===\n*[[Var]]\n*[[Vect]]\n\
      *[[Virtual]]\n|\n===W===\n*[[While]]\n*[[Within]]\n|}\n\n{{Navbox unrealscript}}\n\
      [[Category:Programming articles]]"
